import { ThemeProvider } from '@mui/material';
import './App.css';
import Navbar from './component/Navbar';
import { darkTheme } from './Theme/DarkTheme';

function App() {
  return (
    <ThemeProvider theme={darkTheme}>

      <Navbar />
    </ThemeProvider>
  );
}

export default App;
